import java.util.Map;
import java.util.HashMap;
import java.util.HashSet;
import java.util.Set;

class Solution {
    public String minWindow(String s, String t) {
        Map<Character, Integer> letterCount = new HashMap<>();
        for(char c: t.toCharArray()){
            int count = letterCount.getOrDefault(c, 0);
            letterCount.put(c, count+1);
        }
        int required = letterCount.size();
        int formed = 0;

        Map<Character, Integer> windowCount = new HashMap<>();
        int l = 0, r = 0;
        int minLen = Integer.MAX_VALUE;
        String minLenStr = "";
        int len = s.length();
        while(r < len){
            char cR = s.charAt(r);
            int count = windowCount.getOrDefault(cR, 0);
            windowCount.put(cR, count+1);

            int kk = 0, jj = 0;
            if(letterCount.containsKey(cR)){
                kk = letterCount.get(cR);
                jj = windowCount.get(cR);
            }

            if(letterCount.containsKey(cR) && (kk == jj)){
                formed++;
            }

            if(formed == 26){
                System.out.println("haha");
            }

            //contract
            while(l <= r && formed == required){
                char cL = s.charAt(l);

                if(r-l+1 < minLen){
                    minLen = r-l+1;
                    minLenStr = s.substring(l, r+1);
                }

                if(letterCount.containsKey(cL)){
                    count = windowCount.get(cL);
                    count--;
                    windowCount.put(cL, count);
                    if(letterCount.get(cL) > count) formed--;
                }

                l++;
            }
            r++;
        }
        return minLenStr;
    }

    public static void main(String[] Args){
        Solution s = new Solution();
        String str = "";
        String t = "";
        System.out.println(s.minWindow(str, t));
    }
}